(129, 399, 211, 'Legislacion Comercial', 'El Campo Profundo del Hubble (Hubble Deep Field o HDF en inglés) es una imagen de una pequeña región en la constelación Osa Mayor, basada en los resultados de una serie de observaciones con el telescopio espacial Hubble. Cubre un área de 144 segundos de arco de diámetro, equivalente en tamaño angular a una pelota de tenis a una distancia de 100 metros. La imagen fue compuesta a partir de 342 exposiciones diferentes tomadas con la Wide Field and Planetary Camera 2 (WFPC2) del Telescopio espacial Hubble durante diez días consecutivos entre el 18 y el 28 de diciembre de 1995.', '../ActividadIndividual/ACTIVIDAD6J2E2Z1K2E3K1K9B2L3Continentes.pptx', '../ActividadIndividual/ACTIVIDAD6J2E2Z1K2E3K1K9B2L3Diapositiva.pptx', '2020-07-02 19:43:11 PM', 1, 'ACTIVIDAD6J2E2Z1K2E3K1K9B2L3', 'COD_ACTI8H4V6Q9T1W6L4F6T8Y9'),
