(152, 399, 213, 'Los mejores Momentos Escolares', 'El túmulo alargado Coldrum (en inglés Coldrum Long Barrow), también conocido como piedras Coldrum (Coldrum Stones) o piedras Adscombe (Adscombe Stones), es un túmulo alargado con cámara ubicado cerca del pueblo de Trottiscliffe del condado de Kent, en el sudeste de Inglaterra. Probablemente construido en el cuarto milenio antes de Cristo, durante el período Neolítico inicial de Gran Bretaña, se encuentra en estado de ruina', '../ActividadIndividual/ACTIVIDAD7X4E7T1S2N9O6K8N8Y8product.png', '', '2020-07-21 21:22:48 PM', 1, 'ACTIVIDAD7X4E7T1S2N9O6K8N8Y8', 'COD_ACTI8B3E8F6W3O5H1T7D9I8'),
