(13, 133, 'La historia de Rumania durante la Primera Guerra Mundial abarcó varias fases: primero un periodo de neutralidad que duró desde el estallido de la contienda mundial en 1914 hasta la entrada del país en el conflicto en agosto de 1916; luego una serie de batallas en 1917, enmarcadas entre las que se libraron en el frente oriental; seguidamente un periodo de rendición tras la revolución rusa; y finalmente una reanudación de los combates a finales de 1918. En la guerra el Reino de Rumanía y el Imperio ruso se enfrentaron a los ejércitos de los Imperios Centrales. El país se contó entre los vencedores del conflicto, lo que le permitió aumentar notablemente su territorio y población.', '../trabajos/Infancia.jpeg', '', '', '', '2020-07-25 18:05:08 PM', 1, 'ACTP3L4Q3D8R3G4I7B7C6C5'),
