(81, 372, '<br />\r\nACTIVIDAD DE REPASO<br />\r\nResponda las siguientes preguntas.<br />\r\n<br />\r\n1.	¿Qué es la Mecánica Automotriz?<br />\r\nSe define como aquella rama de la mecánica que en unión con la física y su principio estudia las formas de generación y transmisión de movimiento en los vehículos. <br />\r\n<br />\r\n2.	¿En qué año se inventó el motor de combustión interna?<br />\r\nEl motor de combustión interna se inventó en 1860<br />\r\n               <br />\r\n3.	¿Cómo se llamó el ingeniero que invento el primar motor de combustión interna?<br />\r\nEl ingeniero Joan Joseph Etienne Lenoir<br />\r\n <br />\r\n4.	¿Cómo se llamó el ingeniero que en el año 1885 invento el segundo motor de combustión interna?<br />\r\nEl ingeniero que invento el segundo motor de combustión se llama Karl Friedrich Benz <br />\r\n<br />\r\n5.	¿Henry Ford en que año inicio su producción de los motores T <br />\r\nEn el año que inicio su producción fue en 1904 <br />\r\n<br />\r\n6.	¿Según la Organización Internacional de Constructores de Automóviles cuantos automóviles se fabricaron en el año 2019?<br />\r\nSe fabricaron 100 millones de automóviles en el 2019 <br />\r\n<br />\r\n7.	¿Qué clase de motores tienen los nuevos vehículos que remplazan los de combustión interna?<br />\r\nLos vehículos que remplazan la combustión interna son  los motores eléctricos que funcionan con energía que se almacenan en batería recargable. <br />\r\n<br />\r\n8.	¿Cuáles son las partes generadoras y transmisoras del movimiento en un vehículo?<br />\r\n•	Los motores <br />\r\n•	La correa de distribución <br />\r\n•	El árbol de levas <br />\r\n•	El embargue y la caja de cambios <br />\r\n•	El árbol de transmisión <br />\r\n•	Mecanismo de clases diferencial <br />\r\n<br />\r\n', '../trabajos/respuestas de cuetionario de evaluacio edwin tren.docx', '', '', '', '2020-09-06 11:21:58 AM', 1, 'ACTP8U4T5I9V1W5I9D1M5A5'),
