(99, 510, 'ACTIVIDAD DE REPASO<br />\r\nResponda las siguientes preguntas.<br />\r\nNombre; Edwin tren prados______________________________________________<br />\r\n Fecha: 12/09/2020<br />\r\n1.	Qué significa la palabra automóvil?<br />\r\nQue se mueve por sí mismo <br />\r\n2.	¿Explique el Funcionamiento del Vehículo?<br />\r\nQue el motor recibe una mezcla de aire y gasolina del sistema de alimentación y mediante una chispa eléctrica producida por una bujía, quema la mezcla generando una serie de explosiones dentro de este. <br />\r\n3.	¿Cuáles son los Sistemas que hacen parte del Vehículo?<br />\r\n	El motor <br />\r\n	Sistema de transmisión <br />\r\n	Sistema de frenos <br />\r\n	Sistema eléctrico <br />\r\n	Sistema de dirección <br />\r\n	Sistema de suspensión <br />\r\n4.	¿Cuáles son los Tipos de Vehículos? <br />\r\n	Sedan<br />\r\n	Coupe<br />\r\n	Breck<br />\r\n	Furgoneta <br />\r\n	Camioneta <br />\r\n	Campero <br />\r\n5.	¿Cuáles son los Tipos de Motores? <br />\r\n	Motor de gasolina <br />\r\n	Motor de gas <br />\r\n	Motor de diésel <br />\r\n', '../trabajos/ACTIVIDAD y evaluacion edwin tren.docx', '', '', '', '2020-09-12 17:09:17 PM', 1, 'ACTP3L3K8D1M5C5J5Z2K1P8'),
