(308, 1120, '-Hola amiguitos  mi nombre es Blancanieves y soy una princesa.  saben amiguitos Yo vivo en un gran Castillo que tiene muchas escaleras , pero siempre que voy a subir las escaleras me tropiezo porque soy muy torpe.<br />\r\n- No quisiera  ser torpe  , cada vez que salgo  a dar   un paseo me tropiezo bastante ,  así nunca  conoceré  a un príncipe encantador  por mi gran torpeza .Como desearía  no ser una princesa torpe, me gustaría salir a dar un paseo pero me da miedo caerme en algún hueco .<br />\r\nEntonces vamos amiguitos acompáñeme adar un paseo mientras canto una canción .<br />\r\n-(oh , no , he caído en un hueco me duele mucho la cabeza)<br />\r\n-( auxilio, auxilio , ayúdenme  me he caído  en este hueco feo y profundo)<br />\r\nNadie me escuchara tendré que pasar la noche en ese tenebroso hueco .<br />\r\nOh!! Ya es de mañana gritaré una vez  más<br />\r\n-( auxilio, auxilio,  ayúdenme , escucho unos pasos quién será)<br />\r\nOh!! Es un principe porfavor puede ayudarme  me he caído en este hueco , <br />\r\nMuchas gracias  príncipe  me , puedes llevar  a mi castillo porfavor <br />\r\nOh!! Me siento diferente  que me está pasando  no me e tropezado devuelta al castillo. <br />\r\n-(  oh sí,  oh sí , ya no soy una princesa torpe que felicidad así el príncipe se enamorara de mi .<br />\r\nAmiguitos está fue mi historia de como deje de ser un princesa torpe <br />\r\nMuchas gracias amigos hasta pronto', '../trabajos/IMG_20200929_155230_422.jpg', '', '', '', '2020-09-30 11:12:36 AM', 1, 'ACTP6E5P6C9C3C1X9G4N7H9'),
(310, 1101, 'sujenny dayana ortiz acevedo <br />\r\n', '../trabajos/TALLER PEDAGOGÍA INFANTIL.docx', '', '', '', '2020-09-30 12:58:36 PM', 1, 'ACTP8U6D1Z2B7N8L2K8H1B3'),
