(147, 'IDEA DE NEGOCIO', '<br />\r\n1)	Elabore una idea de negocio, con los requisitos legales para poder conformar dicha empresa, (aplique normas APA) donde este incluya:<br />\r\n<br />\r\nPortada<br />\r\nContraportada<br />\r\nCuerpo del trabajo<br />\r\nConclusiones<br />\r\nBibliografía<br />\r\n<br />\r\nLa idea de negocio se debe componer de: misión, visión, logo, razón social, cantidad de empleados, capital financiero, mobiliario, salarios, descripción de los cargos administrativos y operativos, ubicación geográfica, competencia en el sector, requisitos legales para su conformación, tipo de publicidad escogida.<br />\r\n', '../ActividadIndividual/147IDEA DE NEGOCIO.docx', '/fff', '/fff', '/fff', '/fff', 181, '2020-05-03 22:40:18 PM', ''),
