(39, 18, 47, 'Se trata de una herramienta de mercadeo que puede ser muy útil en una empresa.', 296, 'HAY MÁS PUNTOS TAMBIÉN MUY IMPORTANTES POR MENCIONAR EN EL SIGNIFICADO DE SERV AL CLIENTE'),
