(42, 18, 50, ' Apatía. Desaire. frialdad. Evasivas. Inflexibilidad', 296, 'MUY BIEN'),
(43, 18, 51, ' 	CASO:\r\n	El día 10 de marzo de 2020. Martha se acercó a las oficinas de claro el cuál tomó la iniciativa de ir ya que por llamada telefónica no le daba respuesta alguna. \r\n\r\n	Asesora: Buen día, ¿en qué puedo servirle?\r\n	Martha:  ¿y todavía lo pregunta? (risa irónica) llevo cerca de dos semanas con el mismo problema, vengo a la municipalidad y me dicen: “busca al asesor que te afilió, habla con el gerente”, me dicen que vaya a todos lados y no me dan respuesta de mi solicitud de suspensión de internet que presenté. ¿Es eso justo?\r\n	Asesora: Entiendo que esté enojada, y le doy la razón, es molestoso venir todos los días y no hallar respuesta.\r\n	Martha:  sísí, tengo otras cosas más importantes que hacer, señorita, yo trabajo, y me doy el tiempo para venir, porque la respuesta que le den a mi suspensión de internet repercute mucho en la economía de mi familia.\r\n	Asesora: Realmente lamento esta situación,  ¿podría darme su cargo?\r\n	Martha: si, aquí lo tengo.(entrega hoja a secretaria)\r\n	Asesora: (hace anotaciones en cuaderno) Señorita Martha, no se preocupe, me voy a encargar de que su suspensión de internet pase por el trámite necesario para que de aquí a dos días, obtenga una respuesta.\r\n	Martha: Gracias, y disculpe si fui algo grosera, pero me enojaba mucho esta situación.\r\n	Asesor: No se preocupe, vamos a tratar de agilizar el trámite a su solicitud de suspensión de internet.\r\n	Martha: hasta luego.\r\n	Asesor: que tenga un buen día, estamos para servirle.\r\nSe le dio solución, ya que:\r\n•	El asesor mantuvo la calma\r\n•	Escucho la queja del cliente\r\n•	Mostró empatía\r\n•	Valoró el tiempo del cliente\r\n', 296, 'EXCELENTE'),
(44, 18, 47, ' es el servicio o atención que una empresa o negocio brinda a sus clientes al momento de atender sus consultas, pedidos o reclamos, venderle un producto o entregarle el mismo.', 297, 'BIEN'),
