(53, 18, 51, ' En una agencia de seguros, un cliente compró su SOAT para su automóvil con tarifa para auto familiar, pero luego de un tiempo, está persona es contratada en una empresa con su vehículo con el fin de transportar personas trabajadores de la empresa, por lo cual debe salir de la ciudad y esta tarifa no corresponde a la actividad que va a realizar, por lo que la empresa le exige tener otra tarifa diferente para transporte especial; el cliente solicita a la agencia la cual es intermediaria de la empresa de seguros que por favor le realicen este cambio de tarifa, atendiendo a su solicitud se pide el cambio a la aseguradora, con la cual dan respuesta de pagar el excedente del soat y enviar el soporte, cuando se termina el debido proceso despues de haber enviado lo solicitado por la aseguradora realizan y envían el nuevo SOAT con el cambio de tarifa realizado, con lo cual el cliente puede empezar a trabajar sin ningún inconveniente.', 295, 'MUY BIEN LA HISTORIA, MEJORAR EL USO DE LOS SIGNOS DE PUNTUACIÓN, INTERROGACIÓN, MAYÚSCULAS, ETC'),
