(58, 18, 51, ' Cliente molesto:  Llega un cliente muy molesto a una tienda de ropa muy prestigiosa, porque la mercancia que le vendieron le salio de mala calidad , camisas con huecos, y mal cocidas  intento comunicarse con la empresa de ropa y nadie le dio respuesta y tanto así le toco ir personalmente,a ver que le podían solucionar, las asesoras le dicen que no pueden hacer nada al respeto que se comunique con el gerente de la empresa de ropa, el cliente muy molesto dice que va poner una queja para todos como se puede evitar eso ... SOLUCION: Podemos evitar la queja dándole una solución al cliente primero para no perderlo, y segundo para que vuelva a comprar mas mercancía, le resivimos la mercancía dañada y se la cambiamos por una nueva de mejor calidad y para evitar que no volviera mas le dimo una rebaja de 20 % para su próxima compra en la mercancia.', 291, 'MUY BIEN LA HISTORIA, MEJORAR EL USO DE LOS SIGNOS DE PUNTUACIÓN, INTERROGACIÓN, MAYÚSCULAS, ETC'),
