(88, 18, 51, ' Recepcionista de hotel: Llegó un huésped al hotel y se le informa el procedimiento de pago de los servicios que se disponía a obtener, se le explica que debe cancelar el total de la estancia por adelantado como políticas del hotel, como el cliente realizó su reserva por una aplicación virtual, en ella le exigen datos de la tarjeta para garantizar la misma, el funcionario se molestó porque mal entendió el procedimiento, pensó que desde ahí se cancelaba el hospedaje. La solución fue llamarlo aparte y explicarle paso por paso lo que él había hecho antes de su reserva, informarle las medidas que las aplicaciones toman para garantizar el servicio y demostrarle por medio de estas que su dinero no había sido descargado hasta su llegada al hotel . CLIENTE INSATISFECHO Y MALHUMORADO ', 283, 'EXCELENTE'),
(89, 18, 47, ' Se entiende como aquellos métodos que utiliza una empresa para acercarse a sus clientes o usuarios, que ayudan a  la satisfacción del consumidor, brindándole apoyo, orientación o instrucciones respecto a lo que ellos necesiten.\r\n\r\n', 360, 'MUY BIEN'),
