(91, 18, 49, ' 1. Atender al cliente inmediatamente. 2. Ajustar las reglas algunas veces. 3. Demostrar energía y cordialidad. 4. Pensar en su sentido común. 5 . Hacer que los primero treinta minutos valgan la pena.', 360, 'TAL CUAL'),
(92, 18, 50, ' 1. Mostrarle apatía al cliente. 2.  Tener aires de superioridad.  3. Hacerle un desaire al usuario. 4.  Ser inflexibles. 5. Mostrar frialdad Hacia el usuario.', 360, 'ASÍ ES'),
(93, 18, 51, ' Llega un cliente a un restaurante en las afueras de Barrancabermeja, por recomendación, pues es nuevo en la ciudad y pide la carta para realizar su pedido, resulta que al leer la carta llama su atención la variedad de platos que se ofrecen y pues Hace noción a que cada uno a de estar super delicioso, y no sabe cual escoger. Llama al mesero que inicialmente lo atendió para pedirle su recomendación personal pues el tiene mejor conocimiento de lo que ahí se ofrece. El mesero muy amablemente le  ayuda inicialmente haciéndole preguntas sobre cual es su comida favorita, si le gustaría probar algún plato típico de la ciudad, generando esa seguridad y confianza. hasta tal punto de llegar a descubrir que era lo que se le apetecía comer. ', 360, 'MUY BIEN LA HISTORIA, MEJORAR EL USO DE LOS SIGNOS DE PUNTUACIÓN, INTERROGACIÓN, MAYÚSCULAS, ETC'),
