(98, 18, 51, ' el cliente afanado. en mi empresa me paso una situación con un cliente que  iba a comprar un producto ingreso al área de despacho con afanes que se tenia que ir rápido le dije que la empresa tenia unos protocolos que avía que cumplirlos temas de seguridad social y otras series de documentos en tanto que le explique de la mejor forma me entendió y pudo hacer su compra exitosa. ', 298, 'FALTÓ EL USO BÁSICO DE NORMAS ORTOGRÁFICAS, COMAS, PUNTOS, TILDES... ETC.'),
