(102, 18, 50, ' 1 tener una cultura de servicio solo para fuerza de ventas en el área comercial 2 presentarse inadecuadamente 3 ser flexible mosstrar apatía. 4  ofrecer solo lo que el cliente solicite 5 quitar la atención a los compradores ', 286, 'ASÍ ES'),
