(113, 18, 51, 'Se compra un electrodoméstico  en un almacén de cadena con muy buena atención y garantía del producto. En el momento de la entrega hacen el protocolo de verificación del producto que se encuentre en buenas condiciones, el cliente queda satisfecho con el producto y la atención. Retirando el electrodoméstico y llevándolo a su casa. Al cabo de 6 meses el electrodoméstico falla, el cliente llama al servicio al cliente del almacén de cadena para la garantía donde le responden que lleve el articulo con la factura de compra para su revisión, reparación, cambio o devolución del dinero el cliente lo lleva y el almacén cumple su garantía quedando nuevamente el articulo en buenas condiciones quedando el cliente satisfecho llevándolo para la casa nuevamente.    ', 284, 'EXCELENTE'),
