(165, 46, 71, '+Las ventas se centran en las necesidades del que vende un producto, mientras que *el marketing se focaliza en lo que demandan los clientes.<br />\r\n*El marketing busca resultados a medio y largo plazo, es decir, tiene un carácter más estratégico; por el contrario, *las ventas son el resultado de un largo proceso de producción y buscan la inmediatez.<br />\r\n*Las ventas obligan a conocer a fondo los productos que se ofrecen en un mercado específico; en cambio, *el marketing hace necesario que conozcas el target group o público al que te diriges o que pretendes cautivar.<br />\r\n*El marketing se focaliza en el beneficio y el valor (no monetario) de cada producto, es decir, la utilidad.<br />\r\n *Las ventas enfatizan sus características y el precio.<br />\r\n*Las ventas son un proceso generalmente impulsivo ', 296, ''),
