(179, 46, 73, 'producto:Cuando una persona acude a un establecimiento o visita una web para efectuar una compra como, por ejemplo, una cámara, no solo pide información sobre las características técnicas y el precio, sino que además solicita una información comparativa con otra serie de marcas, así como las ventajas y beneficios que le pueden reportar, tanto para realizar una filmación como para su traslado físico, y se informará seguramente sobre si en ese momento existe alguna oferta o descuento en el precio        servicio:Son una forma de producto que consiste en actividades, beneficios o satisfacciones que se ofrecen a la venta y que son básicamente intangibles y que no tienen como resultado la obtención de la propiedad de algo.', 282, ''),
