(181, 46, 75, '2.	Publicidad competitiva o comparativa: <br />\r\nDove vs. jabón<br />\r\nElegí esta para comenzar porque es de 1960, cuando la publicidad televisiva estaba tomando forma, y podemos ver claramente cómo se instalan ciertos conceptos.<br />\r\nPrimero que esta pieza publicitaria amplía la idea de público objetivo y se insinúa un traslado a la experiencia del cliente. Podríamos decir que trabaja el concepto de ICP (Ideal Profile Client), ya que se dirige directamente a un potencial cliente individual.<br />\r\nSegundo, hablando de la publicidad comparativa, establece una clara línea divisoria entre el lado de “jabones comunes” y el lado Dove “mejor que jabón”5.	Pubicidad de servicio público: <br />\r\n<br />\r\nVanti diferirá el pago de gas de estratos 1 y 2<br />\r\nLa empresa encargada de proveer el servicio de gas en la capital anunció que reconectará el servicio de los usuarios en mora y que diferirá el pago de la mensualidad en los estratos 1 y 2. Esto teniendo en cuenta la emergencia que atraviesa el país por el coronavirus. La compañía anunció que  se le diferirá el pago de la factura a los usuarios residenciales de estratos 1 y 2 que no puedan pagar el servicio este mes.<br />\r\nAsí mismo indicaron que reconectarán el servicio de aquellos que  tengan suspensión por mora y que suspenderán las revisiones periódicas. <br />\r\n3.	Publicidad de refuerzo: <br />\r\nBANCOQUIA<br />\r\n<br />\r\nMientras estuvo en Bancoquia, Juan Manuel Beltrán se desvelaba pensando en cómo hacer para diferenciar a este banco de las demás entidades del sector financiero, y a juzgar por los resultados, los desvelos no fueron en vano. En dos años largos que estuvo en la vicepresidencia de mercadeo, se lanzaron 17 productos nuevos y se logró ocupar el primer lugar en ventas con tarjetas de crédito, aun cuando tenían unos 40.000 tarjetabientes menos que los grandes bancos. Esta proeza se logró gracias al programa de millaje, una idea que Beltrán impulsó desde que entró a la compañía, y en cuyo desarrollo fue vital la experiencia que tuvo trabajando con American Express.<br />\r\n<br />\r\n4.	Publicidad institucional/corporativa :<br />\r\n<br />\r\nBoxitSoft Servicios Web, Productora de Videojuegos<br />\r\nTener un equipo fuerte y talentoso nos permite continuar nuestra misión de crear juegos altamente entretenidos que se adapten mejor a las necesidades móviles de nuestros usuarios. Los proyectos, desde el inicio hasta el lanzamiento, se administran y se producen completamente dentro de nuestra empresa.<br />\r\n<br />\r\n¡La calidad de nuestros juegos nos ha convertido en uno de los principales desarrolladores de Google y ha logrado que nuestra empresa supere nuestro hito de 200 millones de descargas!<br />\r\n10.	Publicidad televisiva:<br />\r\nLa abejita Conavi identificó la corporación de ahorro y vivienda, que nació con la intención de ofrecerles a los colombianos la posibilidad de financiar una vivienda propia. La abejita era sinónimo de obrero y de trabajo. Gracias a ello, esa corporación caló en el inconsciente de la nación y se convirtió en el banco de los colombianos, cuando todavía no se había configurado el actual concepto de entidades bancarias. De ahí los lemas Conavi quiere a la gente y la gente quiere a Conavi.<br />\r\n<br />\r\n', 282, ''),
