(200, 46, 71, '1   las ventas se enfocan en vender en producto y el marketing en tener el producto     2  la venta  hace uso de promociones o descuentos para q nuestros clientes compren mas, y el marketing prefiere la compra impulsiva    3 el marketing se encarga en q las personas ganen y las ventas en q la empresa obtenga mayor ganancias. 4  en la  venta se busca q los clientes compren, y despues otro compre y otro y otro... en cambio en el marketing   buscan fidelizar a cada persona    5     es importante para la ventas dar a conocer las caracteristicas del producto y el precio y en el marketing se centran en los beneficios del producto.', 286, ''),
(201, 46, 72, 'cosas que son necesarias para alguien o algo,  cuando se necesita mucho un elemento, o servicio... es algo que resulta indispensable para vivir.', 286, ''),
(202, 46, 73, 'un producto y un servicio  es algo que se puede ofrecer a las personas para satisfacer sus necesidades , un servicio es algo que las personas no persiven fisicamente pero tiene cualidades similares a un producto.', 286, ''),
(203, 46, 74, 'primario :  la pesca  (pesquera del mar )      secundario  : obtencion de fuentes de energia   ( ESSA)    terciario : medicina ( clinica san jose )', 286, ''),
(204, 46, 75, '. anuncios de radio,  se escucha en las emisoras 2 públicidad on line , atravez de interneth  3 publicidad impresa periodico revistas o folletos 4 anuncios de television, imagen y sonido  5 exterior aparece en  lugares publicos ', 286, ''),
(205, 46, 76, 'escojo cocacola por que es una empresa con  grandes canaales de distribucion, una clientela amplia ademaas de que la publicidad siempre se ha caracterizado por ser la mejor mundialmente y trambien patrocinado de grandes empresas ', 286, ''),
(206, 46, 71, 'venta: se centra en las necesidades del vendedor y en el marketing se centra en las necesidades que tenga el comprador. 2 en venta busca resultado a corto plazo y en marketing busca resultado a largo, corto y mediano plazo. 3 en ventas lo importante es que la empresa gane y en el marketing lo importante es que gane el cliente sino gana el cliente, la empresa no gana', 364, ''),
(207, 46, 72, 'Una necesidad es el estado de un ser en que se halla en carencia, ya que esta  resulta indispensable para vivir en un estado de bienestar corporal pleno. ', 364, ''),
(208, 46, 73, 'Un producto es una opción elegible, viable y repetible que la oferta pone a disposición de la demanda ya que esto satisface a una necesidad o atender un deseo a través de su uso o consumo.  Un servicio representa un conjunto de acciones, las cuales las cuales son realizadas para servir a alguien, algo o alguna cosa.  En ventas hacer todo lo posible para que el cliente compre y en marketing no todo vale para que el cliente compre.', 364, ''),
(209, 46, 74, 'Producción, distribución, consumo. en función de la división de la economía clásica, las actividades económicas se clasifican en 3 grupos ', 364, ''),
(210, 46, 75, 'Publicidad de radio: Es un medio tradicional que ya esta muy asentado entre la población y que a día de hoy sigue siendo muy efectivo en algunos casos.  Televisión: Es uno de los medi0os de publicidad mas reconocidos y accesibles a la gran mayoría de la población. Impresa: junto a la televisiva y la radio son una de las mas antiguas que puedes ver en este articulo se trata de hacer. publicidad en medios como revistas o diarios. Telefónica a diferencia de esta anteriormente, en la publicidad telefónica se conoce un contacto y comunicación real con el tarje al que queremos llegar  ', 364, ''),
(211, 46, 76, '', 364, ''),
(212, 46, 71, 'Marketin se encarga de ustudiear lo que el cliente necesita y venta  esta centrada en el vendedor ', 363, ''),
(213, 46, 72, '', 363, ''),
(214, 46, 73, 'Producto en un bien que podemos palpar ejm un vaso  y servicio  no lo podemos ver ni palpar ', 363, ''),
(215, 46, 74, '', 363, ''),
(216, 46, 75, 'Pionera se refiere al lanzamiento de un nuevo producto publicidad Boca boca es la que utiliza la empresa para darse a conocer entre los propios publicidad ', 363, ''),
(217, 46, 76, 'Coca cola el plan de negosi esta enfocado a comercializar bebidas para todo tipo de clientela ', 363, ''),
(218, 46, 71, ' 1)El marketing es de uno a muchos  VENTAS Las ventas son de uno a uno, MARKETING:  el  Resultados normalmente a largo plazo,VENTAS:Resultados normalmente a corto plazo, MARKETING:El marketing muestra cómo llegar a los clientes y construir una relación de larga duración.VENTAS:La venta es el resultado de la buena gestión del vendedor y de la campaña de marketing.MARKETING:Se dirige a la construcción de una identidad de marca para que sea fácilmente asociado con la satisfacción de una necesidad.VENTAS:Las ventas son la estrategia para satisfacer necesidades de un individuo, impulsados por la interacción humana. Es la capacidad de satisfacer una necesidad en el momento adecuado. MARKETING:El marketing tiene alcance en la investigación de mercado, la publicidad, las ventas, las relaciones públicas, el servicio al cliente y la satisfacción.VENTAS: vez que un producto ha sido creado por una necesidad del cliente, las ventas persuaden al cliente a comprar el producto para satisfacer sus necesidades.', 356, ''),
(219, 46, 72, 'SE DEFINE A LA NECESIDAD COMO AQUELLAS ASPIRACIONES POR PARTES DE LOS CONSUMIDORES EN TÉRMINOS  DE VIENES Y SERVICIOS DECIR COMO AQUELLOS PUNTOS A SATISFACER POR PARTE DE LAS EMPRESAS MEDIANTE EL OFRECIMIENTO DE SUS PRODUCTOS EN EL MERCADO ', 356, ''),
(220, 46, 73, 'UN PRODUCTO ES UN CONJUNTOS  DE CARACTERÍSTICAS Y ATRIBUTOS TANGIBLES ( FORMA, TAMAÑO Y COLOR) E INTANGIBLES ( MARCA IMAGEN DE EMPRESA Y SERVICIO QUE EL COMPRADOR ACEPTA EN PRINCIPIOS COMO ALGO QUE VA A SATISFACER SUS NECESIDADES.', 356, ''),
(221, 46, 74, 'EL SECTOR PRIMARIO, SECTOR SECUNDARIO, SECTOR TERCIARIO Y CUAT', 356, ''),
(222, 46, 75, 'Publicidad informativa: RCN<br />\r\nPublicidad comparativa:ADIDADAS<br />\r\nPublicidad Transformativa:AVIACA<br />\r\nPublicidad emotiva:   REVUSTA DE DINERO   publicidad eVngañosa :EXITO', 356, ''),
(223, 46, 76, 'COCA COLA: SU PLAN DE NEGOCIO ES HACER UN MERCADEO DE PREVENTISTA, CATALOGO, TELE VENTAS DE IGUAL MANERA BRINDA AL CLIENTE SOLUCIONES A SUS CLIENTE POR UNA LINEA DE LLAMA, SU DISTRIBUCIÓN DE CAMIONES, CAMIONETAS, Y ASÍ HACEN PROMOCIONES EN EL MERCADO PARA TENER COMPETITIVIDAD Y ETIQUETIVAS VENTAS  ', 356, '');
