(1151, 2351, 'concepto incompleto...<br />\r\nSon comerciantes las personas que ejerzan alguna profesión u oficio que la ley considere mercantil, ya que la actividad sea ejecutada por la misma persona o por un tercero o apoderado.<br />\r\nPara ser comerciante es necesario estar matriculado en el registro mercantil, que es el que le permite acreditar públicamente su calidad de comerciante,<br />\r\nPersonas que venden y compran bienes o servicios, de acuerdo con las normas pertinentes para tales fines. Estos deben estar inscritos en la cámara de comercio con su registro mercantil y de antemano, con un establecimiento abierto al público enunciando sus productos de forma publicitaria.<br />\r\n', '1.5'),
(1152, 2352, 'Respuesta muy abierta<br />\r\n<br />\r\nEl Derecho mercantil o Derecho comercial rama del Derecho privado que regula el conjunto de normas relativas a los comerciantes en el ejercicio de su profesión, a los actos de comercio legalmente calificados como tales y a las relaciones jurídicas derivadas de la realización de estos. <br />\r\nEl derecho comercial o derecho mercantil se encarga de hacer cumplir las leyes o normas estipuladas en el Código de Comercio de la República de Colombia, las cuales rigen a los establecimientos de comercio, a los comerciantes y como tal a todos los actos de comercio.<br />\r\n', '2.2'),
(1153, 2353, 'falto mencionar algunas características importantes...<br />\r\nSon comerciantes las personas que ejerzan alguna profesión u oficio que la ley considere mercantil, ya que la actividad sea ejecutada por la misma persona o por un tercero o apoderado.<br />\r\nPara ser comerciante es necesario estar matriculado en el registro mercantil, que es el que le permite acreditar públicamente su calidad de comerciante,<br />\r\nPersonas que venden y compran bienes o servicios, de acuerdo con las normas pertinentes para tales fines. Estos deben estar inscritos en la cámara de comercio con su registro mercantil y de antemano, con un establecimiento abierto al público enunciando sus productos de forma publicitaria.<br />\r\n', '2.0'),
(1154, 2354, 'Muy bien!', '2.5'),
(1155, 2356, 'concepto errado.<br />\r\nSon comerciantes las personas que ejerzan alguna profesión u oficio que la ley considere mercantil, ya que la actividad sea ejecutada por la misma persona o por un tercero o apoderado.<br />\r\nPara ser comerciante es necesario estar matriculado en el registro mercantil, que es el que le permite acreditar públicamente su calidad de comerciante,<br />\r\nPersonas que venden y compran bienes o servicios, de acuerdo con las normas pertinentes para tales fines. Estos deben estar inscritos en la cámara de comercio con su registro mercantil y de antemano, con un establecimiento abierto al público enunciando sus productos de forma publicitaria.<br />\r\n', '0.5'),
(1156, 2358, 'no indicó el concepto de derecho comercial o mercantil<br />\r\nEl Derecho mercantil o Derecho comercial rama del Derecho privado que regula el conjunto de normas relativas a los comerciantes en el ejercicio de su profesión, a los actos de comercio legalmente calificados como tales y a las relaciones jurídicas derivadas de la realización de estos. <br />\r\nEl derecho comercial o derecho mercantil se encarga de hacer cumplir las leyes o normas estipuladas en el Código de Comercio de la República de Colombia, las cuales rigen a los establecimientos de comercio, a los comerciantes y como tal a todos los actos de comercio.<br />\r\n', '1.5'),
(1157, 2359, 'a este oficio? cual oficio? de que forma se debe ejercer ese oficio para que sea considerado comerciante...? <br />\r\nSon comerciantes las personas que ejerzan alguna profesión u oficio que la ley considere mercantil, ya que la actividad sea ejecutada por la misma persona o por un tercero o apoderado.<br />\r\nPara ser comerciante es necesario estar matriculado en el registro mercantil, que es el que le permite acreditar públicamente su calidad de comerciante,<br />\r\nPersonas que venden y compran bienes o servicios, de acuerdo con las normas pertinentes para tales fines. Estos deben estar inscritos en la cámara de comercio con su registro mercantil y de antemano, con un establecimiento abierto al público enunciando sus productos de forma publicitaria.<br />\r\n', '1.5'),
(1158, 2362, 'No dió el concepto de derecho comercial o mercantil.<br />\r\nEl Derecho mercantil o Derecho comercial rama del Derecho privado que regula el conjunto de normas relativas a los comerciantes en el ejercicio de su profesión, a los actos de comercio legalmente calificados como tales y a las relaciones jurídicas derivadas de la realización de estos. <br />\r\nEl derecho comercial o derecho mercantil se encarga de hacer cumplir las leyes o normas estipuladas en el Código de Comercio de la República de Colombia, las cuales rigen a los establecimientos de comercio, a los comerciantes y como tal a todos los actos de comercio.<br />\r\n', '1.0'),
(1159, 2363, 'Es importante resaltar que para ser considerado comerciante debe ejercer estos oficios de manera habitual y que adicionalmente es fundamental inscribirse en el registro mercantil.', '2.0'),
