(1165, 2371, 'que se dedica habitualmente al trabajo??<br />\r\n<br />\r\nSon comerciantes las personas que ejerzan alguna profesión u oficio que la ley considere mercantil, ya que la actividad sea ejecutada por la misma persona o por un tercero o apoderado.<br />\r\nPara ser comerciante es necesario estar matriculado en el registro mercantil, que es el que le permite acreditar públicamente su calidad de comerciante,<br />\r\nPersonas que venden y compran bienes o servicios, de acuerdo con las normas pertinentes para tales fines. Estos deben estar inscritos en la cámara de comercio con su registro mercantil y de antemano, con un establecimiento abierto al público enunciando sus productos de forma publicitaria.<br />\r\n', '1.0'),
(1166, 2372, 'solo enuncio  una obligación correctamente <br />\r\n<br />\r\nMatricularse en el registro mercantil <br />\r\nInscribir en el registro mercantil todos los actos, libros y documentos respecto de los cuales la ley exija esa formalidad. <br />\r\nLlevar contabilidad regular de sus negocios conforme a las prescripciones legales. <br />\r\nConservar, con arreglo a la ley, la correspondencia y demás documentos relacionados con sus negocios o actividades. <br />\r\nAbstenerse de ejecutar actos de competencia desleal. <br />\r\n', '1.2'),
(1167, 2373, '', '2.5'),
(1168, 2374, 'La matricula es en el Registro Mercantil, el registro civil es el que se le hace a los recién nacidos.<br />\r\n<br />\r\nMatricularse en el registro mercantil <br />\r\nInscribir en el registro mercantil todos los actos, libros y documentos respecto de los cuales la ley exija esa formalidad. <br />\r\nLlevar contabilidad regular de sus negocios conforme a las prescripciones legales. <br />\r\nConservar, con arreglo a la ley, la correspondencia y demás documentos relacionados con sus negocios o actividades. <br />\r\nAbstenerse de ejecutar actos de competencia desleal. <br />\r\n', '1.2'),
