INSERT INTO `preguntas` (`id`, `id_clase`, `id_evaluacion`, `nombre`, `tipo_pregunta`, `codigo`) VALUES
(30, 211, 36, '¿Cuantas manzanas existen en la mesa de Koberty?', 1, 'IDE6V9B2C1J2N2I3V2X4Q6N2C2D6T9Z2'),
(57, 210, 33, '¿Quienes Jugaron en contra?', 2, 'PM4Q9G2D9Q5W9B4W5U4M1'),
(110, 218, 46, '¿Quien ganó la batalla?', 2, 'PM1N1C2Z2J2U8U4I4H5K3'),
(111, 218, 46, '¿Quien es jonas?', 1, 'IDE2U3Y1E7W4G7C8U5L8D9U2L7Y3O9C9'),
(112, 219, 47, '¿Porque los niños no juegan a carrito?', 2, 'PM4A2I4H9P8B1T3Y2M3M1'),
(113, 219, 47, '¿Quienes lograron ganar?', 1, 'IDE5K5J4W1B9J6Z6Z9Y1R8L5P2P3E4L6'),
(116, 229, 48, 'Quien creo la batalla ?', 2, 'PM9T8R5P9G2Z2E4E7A3M2'),
(117, 229, 48, '¿Quien fué romeo?', 1, 'IDE5I1R1Q6E8N1M4E9Q6A7R7S3O7D3J6'),
(118, 230, 50, '4.	Son aquellos donde existe un inminente peligro para la vida. Generalmente riesgos atmosféricos (gases inflamables y/ o tóxicos, deficiencia o enriquecimiento de oxigeno.', 2, 'PM1A1O2X2A5C6J8K2K6Z3'),
(119, 230, 50, '3.	Significa el cierre de una línea, conducto o tubería mediante el cierre y etiquetado de dos válvulas, y la apertura, entre las dos válvulas cerradas, de un drenaje o abertura de ventilación hacia la atmósfera externa.', 2, 'PM4I5U4P2L9L4I1W1M4T4'),
(120, 230, 50, '1.	¿Qué se entiende por “ESPACIO CONFINADO?', 1, 'IDE6J3N9G1E3E1O5Q1M2U8D3O6B6Q1D9'),
(121, 230, 50, 'Es la concentración límite, ponderada en el tiempo para una jornada normal de 8 horas y 40 horas semanales, a la cual los trabajadores pueden estar expuestos sin sufrir daños para su salud', 2, 'PM4L3H1J4Z4Y2E2R4I2I3'),
(123, 230, 50, '¿Qué son los Valores Límites Permisibles?', 1, 'IDE1J8T6T7H4O4I5Z2I3N2W8B4Q3R4E6'),
(124, 230, 50, 'Una atmósfera que contiene una concentración de oxígeno mayor de 21% por volumen', 2, 'PM8I5Q2W8P4G3H7E3F6Q3'),
(126, 208, 51, 'LA PATRONITA', 2, 'PM6R1E9B4C2Y4G8Q5I4K1'),
(127, 220, 52, 'LOLO1', 2, 'PM9R1S3A4Y6J9A8W3G4I3'),
(141, 230, 50, 'los tipos de espacios confinados son', 2, 'PM9T5C6E7V8V8Y4L7A5Z4'),
(158, 217, 58, '¿Selecciones las enfermedades laborales?', 2, 'PM3O8C5M5B4H3Q7Z3V2R3'),
(159, 233, 59, 'Una atmósfera que contiene menos del 19.5% de oxígeno por volumen se conoce como', 2, 'PM6J6Z7Z5Q7L4R3F6P5L1'),
(160, 233, 59, 'Corresponde a los espacios confinados donde las situaciones de peligro no exigen modificaciones especiales a los procedimientos normales de trabajo o el uso de EPP adicionales', 2, 'PM4M1W5C1W5G2T9X1R5N8'),
(161, 233, 59, 'La ventilación es una técnica de control sencilla y eficaz, que puede aplicarse de forma', 2, 'PM7I5H4A4J2R6I2S2R5V8'),
(162, 233, 59, 'La ventilación es una de las medidas preventivas fundamentales para asegurar la inocuidad de la atmósfera interior del espacio confinado ', 2, 'PM4G1O2U2D7C5Q2B1F4W7'),
(163, 233, 59, 'El objetivo de la ventilación sacar oxigeno en una atmósfera exterior e introducir una concentración de contaminantes o sustancias inflamables al interior de un Espacio Confinado  ', 2, 'PM7M4K1V6G3M1D3V2L4D6'),
(164, 233, 59, 'Dentro de los Equipos dependientes del medio ambiente o equipos filtrantes. El aire inhalado pasa a través de un filtro donde se eliminan los contaminantes ', 2, 'PM6V3K5L7H3P6P3Y8F4K4'),
(165, 233, 59, 'En un Espacio confinado es imprescindible realizar mediciones de los agentes peligrosos presentes y determinar su concentración ', 2, 'PM8C6U2V7T2L1L3G8N7A4'),
(166, 233, 59, 'La clasificación de la NIOSH se basa en la existencia de riesgos existentes o potenciales relativos al espacio confinado, la clasificación está basada en las características del espacio confinado', 2, 'PM4A4F8D4T4U3M3F8R9W5'),
(167, 233, 59, '¿Que es TLV-TWA (Valor Límite Umbral   Media Ponderada en el tiempo)?', 1, 'IDE8F8D7R2J7K7Y9I5U2F2Q5K4F6X3Q9'),
(168, 233, 59, '¿Diga los tres riesgos existentes  o potenciales relativos  que se basa la NIOSH para la clasificación de los espacios confinados?', 1, 'IDE2I9L6G6Q7Z6R7Y4J9E9C6N4G3A9H6'),
(172, 285, 61, '¿QUE ESTUDIA LAS MATEMÁTICAS FINANCIERAS?', 1, 'IDE6Z2G1L7S3P7D3C9Q3I4E8A6E8B5G8'),
(173, 285, 61, 'En el uso del dinero intervienen cuatro conceptos, mencione dos. ', 1, 'IDE8K8L9U6M9E7N8D6K7Y6M6F3C6V1B3'),
(174, 285, 61, '¿QUE ES INTERES SIMPLE?', 1, 'IDE7D7Y6V9A6G8F9N2J2U8F2K4S3W3V5'),
(175, 285, 61, 'Mencione las clases de interés simple que existen.', 1, 'IDE9P7V2T9F8Y8S6T9N2I6U9F9B5Z5G4'),
(182, 269, 63, '1.	¿Qué significa la palabra Automóvil? ', 2, 'PM9A6R9Y6W1X4A6S3H5A9'),
(183, 269, 63, '2.	¿Cuáles son las partes que se integran para el Funcionamiento del Vehículo?', 2, 'PM2I2E7K9W9L2T9A9P1T8'),
(184, 269, 63, '3.	¿Cuáles son los Sistemas que hacen parte del Vehículo?', 2, 'PM4U8X8J5B7I1K6C9F6R1'),
(185, 269, 63, '4.	¿Cuáles son los Tipos de Vehículos? ', 2, 'PM5Y8A7T3V3U3O2K1O1T4'),
(186, 269, 63, '5.	¿Cuáles son los Tipos de Motores de combustión interna según el combustible usado? ', 2, 'PM8U7Z6J4Q2K4A2I9L8K5'),
(189, 268, 65, '1.	¿Qué significa mecánica automotriz?', 2, 'PM6D2F8W3U4Q9O8S3E3E9'),
(190, 268, 65, '2.	¿En qué año se inventó el motor de combustión interna?', 2, 'PM7R1T9H5T8F1P8C1W5A5'),
(191, 268, 65, '3.	¿Cómo se llamó el ingeniero que invento el primar motor de combustión interna?', 2, 'PM7A6H7Q7K4J9L6R1E7X2'),
(192, 268, 65, '4.	¿Qué clase de motores tienen los nuevos vehículos que remplazan los de combustión interna?', 2, 'PM4L8O2D8Q6B8Q8S4D2A8'),
(193, 268, 65, '5.	¿Cuáles son las partes generadoras y transmisoras del movimiento en un vehículo?', 2, 'PM2Q4V2Q5Q6S1T3Q7I9H7'),
(194, 297, 67, 'Es la aplicación racional y con inventiva de las ciencias y técnicas que tienen por objeto el reconocimiento, evaluación y control de aquellos factores ambientales que se originan en el lugar de trabajo, que puedan causar enfermedades, perjuicios a la salud e incomodidades entre los trabajadores o miembros de una comunidad', 2, 'PM9X2W5W5X5Q3U9X6Y7M2'),
(195, 297, 67, 'Se concibe como las condiciones físicas a aquellas que se encuentran en el lugar de trabajo.', 2, 'PM1Q1L4X2P6I6Z7Q3R2Q9'),
(196, 297, 67, 'Se ocupa de la prevención y preservación de la salud de las personas que se desempeñan en el ámbito laboral, como así también del control del buen estado de salud de los trabajadores como una alternativa para obtener un recurso humano más eficiente ', 2, 'PM9G9H4K3N3R5J4M6A5Y4'),
(197, 297, 67, 'Son las normas que fijan los requisitos para la defensa de la salud y la vida de los trabajadores en los establecimientos y lugares de trabajo y las que determinan las prestaciones que deben percibir los hombres por su trabajo.<br />\r\n', 2, 'PM4Y1V5F9O2H4M9C3P5P8'),
