(458, 443, 126, 'Las siguientes normativas hacen parte del fundamento del comité de convivencia laboral Resolución 2013 de 1986.Decreto 614 de 1984.Resolución 1016 de 1989. Decreto 1295 de 1994. Decreto 1530 de 1996. Resolución 1401 de 2007. Ley 1562 de 2012. Decreto 0723 de 2013. ', 2, 'PM7Z4F5B4R4U4N4H3V2F5'),
(459, 443, 126, 'Es un grupo de empleados, conformado por representantes del empleador y representantes de los empleados, que busca prevenir el acoso laboral contribuyendo a proteger a los empleados contra los riesgos psicosociales que afectan la salud en los lugares de trabajo', 2, 'PM4V4X8N3K8A5B3N1K9P1'),
(460, 443, 126, 'Cuando exista una variación 	de las condiciones existentes en el momento de su elaboración o cuando se dicten disposiciones gubernamentales que modifiquen las normas del Reglamento o que limiten su vigencia se debe', 2, 'PM7B1H4N3I2R9O5N8M6W7'),
(462, 443, 126, '“Toda conducta persistente y demostrable, ejercida sobre  un empleado, trabajador por parte de un empleador, un  jefe o superior jerárquico inmediato o mediato, un  compañero de trabajo o un subalterno, encaminada a  infundir miedo, intimidación, terror y angustia, a causar  perjuicio laboral, generar desmotivación en el trabajo, o  inducir la renuncia del mismo. Ley 1010 de 2006, Art 2. Se conoce como:', 1, 'IDE6Z6S3O1A7D8M7M4G8K1I4N2C5U6M5'),
(463, 443, 126, '¿Qué es el reglamento de Higiene y Seguridad? ', 1, 'IDE6L6G1O9S2Y5X9A7Z7D5O8E2I2O3H7'),
(464, 444, 127, 'El diagnostico es el eje central del sistema, pues  es la que direcciona hacia donde la  empresa enfocara sus acciones, recursos,  es decir, todo tendiente a mejorar los  ambientes de trabajo, la seguridad de los  empleados y su salud', 2, 'PM9H6V2G8Y5K6H2U7S7M9'),
(465, 444, 127, 'Es la que nace de la relación laboral o contrato de trabajo, mediante el cual los empleados están protegidos contra contingencias que se ocasiones a causa u ocasión del trabajo, reconociendo de forma principal la promoción, prevención, prestación económicas y asistenciales por accidentes ', 2, 'PM7N1A8E7Y9H7J6C4E3S1'),
(466, 444, 127, 'Diga los 4 Tipos de responsabilidad del empleador', 1, 'IDE3E2A9V6P6U3C7D9D5N6H8U8W1P6V9'),
(467, 444, 127, '¿Cuándo surge la Responsabilidad laboral?', 1, 'IDE9R1T1J6E3P3A4Y1S7O2P2V1H1I5C7'),
(468, 444, 127, 'Es la obligación de responder económicamente por los daños causados a terceros.', 2, 'PM6U8Z8X6J9Q6J8X3E8Z9'),
(469, 444, 127, 'la obligación del empleador para indemnizar al trabajador, surge por la negligencia en el cuidado y protección del mismo, deberá pagar los perjuicios causados en el accidente de trabajo o enfermedad laboral,', 2, 'PM8I1Q9E3H7L7F2K7O2O8'),
(470, 444, 127, '«Por regla general todo daño que pueda imputarse a malicia o negligencia de otra persona, debe No debe ser reparado por ésta».', 2, 'PM1G2D5P7O1X4D8R9W1P1'),
(471, 444, 127, 'La responsabilidad penal es, en Derecho, la sujeción de una persona que vulnera un deber de conducta impuesto por el Derecho penal al deber de afrontar las consecuencias que impone la ley. Dichas consecuencias se imponen a la persona cuando se le encuentra culpable de haber cometido un delito o haber sido cómplice de éste.<br />\r\n', 2, 'PM5B6X3G3G4A6J7D5H9J6'),
(472, 444, 127, 'En accidente de trabajo o enfermedad profesional las generalidades de la<br />\r\nCULPA, pueden ser ocasionadas por NEGLIGENCIA, IMPRUDENCIA O IMPERICIA ', 2, 'PM8H4V8E7J3Q2V2P8N5S1'),
(473, 444, 127, 'Todo perjuicio o daño causado a terceros por la acción u omisión de un acto administrativo', 2, 'PM2G7M3B9N4V1L9F8X7L8'),
