(489, 510, 138, 'Se entiende bajo esta denominación la existencia de elementos, fenómenos, ambiente y acciones humanas que encierran una capacidad potencial de producir lesiones o daños materiales', 2, 'PM3A2L4M3E2N8X9H7M3Z1'),
(490, 510, 138, 'Es la Combinación de la probabilidad y la(s) consecuencia(s) de que ocurra un evento peligroso o un accidente. Se pueden medir y cuantificar', 2, 'PM2F5E7J5Z3C1W8Y8B5Y1'),
(491, 510, 138, 'Se concibe como las condiciones físicas a aquellas que se encuentran en el lugar de trabajo', 2, 'PM4Y8U9K6V9X9O6O4V4Z3'),
