(493, 510, 138, 'consiste en un conjunto de técnicas y procedimientos que tienen por objeto evitar y, en su caso, eliminar o minimizar los riesgos que pueden conducir a la materialización de accidentes con ocasión del trabajo ', 2, 'PM1G6M4E3J3L9G4R8H1U6'),
(494, 510, 138, 'Es una técnica de prevención de enfermedades laborales mediante la actuación en el medio ambiente de trabajo', 2, 'PM6A9H5P5H5Q4Y4I9O1S1'),
