(178, 720, 70, 220, 'Estructura de la cuenta . La cuenta se divide en 2 parte ; una de ellas se destinan a recoger los aumentos de valor  y la otra recoge las disminuciones. Las anotaciones en el debe o en el haber se puede sumar y ambas sumas representa la dinámica de cada cuenta ', '2020-09-17 22:25:36 PM', 'REEVA4W8A5H3M5I2X5D7E1V4U8M5N'),
